create extension if not exists "uuid-ossp";

drop table if exists dogdata;
drop table if exists messagedata;
drop table if exists ownerdata;
drop table if exists breeddata;
drop table if exists locationdata;

create table if not exists testImage (
    imageID int primary key,
    imageFile text
);

create table if not exists breedData (
    breedID int primary key,
    breedName text,
    breedImage text
);

create table if not exists locationData (
    locationID int primary key,
    locationName text,
    locationLat varchar(10),
    locationLon varchar(10)
);

create table if not exists ownerData (
    ownerID int primary key,
    ownerName varchar (30),
    ownerPass varchar (30),
    ownerLocation int references locationData(locationID)
);

create table if not exists dogData (
    dogID int primary key,
    dogName varchar(20),
    dogAbout varchar(500),
    dogAge int,
    dogSex varchar(6),
    dogBreed int references breeddata(breedID),
    dogOwner int references ownerData(ownerID)
);

create table if not exists messageData (
    messageID uuid default uuid_generate_v4() primary key,
    messageTime timestamp default now(),
    messageContent text,
    messageSender int references ownerData(ownerID),
    messageReceiver int references ownerData(ownerID)
);




